title: ContainerFull
type: object
required:
  - ean
  - count
description: |-
  Returns list of only accepted containers <br> Where one record contains only one occurence of EAN e.g. <br> { <br>
    "ean": "123422",<br>
    "count": 100, <br>
  }

  The list includes only containers accepted since the last bag replacement.
properties:
  ean:
    type: string
    example: '20123123'
  count:
    type: integer
    example: 20
